import React from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './Components/Header';
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Boi
        </p>
      </header>
      <div>
        <Header />
      </div>
    </div>
  );
}

export default App;
